            "start": 1700,
            "details": "\r\n<p>During the Late Byzantine and Ottoman periods, the village (on the ruins of the ancient town) was called <em>Kapurna</em> or <em>Kaprena</em>. Sometime in 19th century it was officially renamed to <em>Chaeronea</em>, although \"Kapurna\" is still found in some non-Greek bibliography and maps until the early 20th century and was unofficially used by the locals until the late 20th century.</p>\r\n",
